import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import Cookies from 'universal-cookie';
import './login.css';


function Login() {
  const history = useNavigate();
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const cookies = new Cookies();

  const submit = async (e) => {
    e.preventDefault();

    // Add a validation check for empty email or password
    if (!email || !password) {
      alert("Please enter both email and password");
      return;
    }

    try {
      const response = await axios.post("http://localhost:3001/login", {
        email,
        password,
      });

      if (response.data.message === "Login successful") {
        cookies.set("user", email, { path: "/" });
        sessionStorage.setItem("email", email);
        // Set user category in session storage when the user logs in
        sessionStorage.setItem("userCategory", category);

        history("/admin", { state: { id: email } });
      } else if (response.data.message === "User not found") {
        alert("User not found");
      } else if (response.data.message === "Invalid password") {
        alert("Invalid password");
      }
    } catch (error) {
      alert("Error occurred. Please check your details and try again.");
      console.error(error);
    }
  };

   
  return (
    
    <div>
         <header className="header">
        <div className="logo-container">
          <img src="data:image/png;base64," alt="Logo" className="logo" />
         
          <h1>Library Management System</h1>
        </div>
      </header>
      <nav className="navbar">
        <a href="#home">Home</a>
        <a href="#gallery">Gallery</a>
        <a href="#how-it-works">How It Works</a>
        <a href="#plans">Plans</a>
        <a href="#about">About</a>
        <a href="#contact-us">Contact Us</a>
      </nav>
      <div className="content-container">
        <div className="book-image">
        <img src="https://i0.wp.com/stanzaliving.wpcomstaging.com/wp-content/uploads/2022/04/fc23e-library-in-jaipur.jpg?fit=1000%2C667&ssl=1" alt="Person touching a virtual screen" height="400" width="650" />

        </div>
        <div className="login-container">
          <div className="login-form">
            <img  src="data:image/jpeg;base64," alt="Login Logo" className="login-logo" height={60}/>
            <form onSubmit={submit}>
<label>Email</label>
<input type="email" name="email" value={email} onChange={(e) => setEmail(e.target.value)} />

<label>Password</label>
<input type="password" name="password" value={password} onChange={(e) => setPassword(e.target.value)} />

<button type="button  "   onClick={submit} disabled={!email || !password}>
          Login
        </button>


<div className="mt-3 text-center">
                <p className="small text-muted">
                  Don't have an account? <Link to="/registration">Register here</Link>
                </p>
                <p className="small text-muted">
                  Forgot your password? <Link to="/ForgotPassword">Reset it here</Link>
                </p>
              </div>
</form>
            
          </div>
        </div>
      </div>
    </div>


  );
};


export default Login;
